syntax = "proto3";

package make87_messages_ros2.rolling.ublox_ubx_msgs.msg;


message CorStatusInfo {
     uint32 protocol = 1;
     uint32 err_status = 2;
     uint32 msg_used = 3;
     uint32 correction_id = 4;
     bool msg_type_valid = 5;
     bool msg_sub_type_valid = 6;
     bool msg_input_handle = 7;
     uint32 msg_encrypted = 8;
     uint32 msg_decrypted = 9;
}
